import React from "react";
import "./Contact.css";

import emailjs from "emailjs-com";

const Contact = () => {
  function sendEmail(e) {
    e.preventDefault();

    emailjs
      .sendForm(
        "gmail",
        "template_5hnu26o",
        e.target,
        "user_CwNptdn7yDUpmXHZDgVci"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    e.target.reset();
  }
  return (
    <div id="contact" class="contact">
        <h1>Contac</h1>
    </div>
  );
};

export default Contact;
